import ReactDOM  from "react-dom";
// import meh , {vill ,muName,muNames} from "./App";    or
 import * as ques from "./App"

ReactDOM.render(
  <>
<ol>
  <li>Name </li>
  {/* <li>{ ques.me}</li>
  <li>{ques.me}</li> */}
  <li>{ques.vill } </li>
  <li>{ques.muName() } </li>
  <li>{ques.muNames() } </li>
</ol>
  </>,
   document.getElementById("root")
);
